  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:54.168796\",\n\t\"name\": \"contaminants-in-southwestern-willow-flycatcher-eggs-and-prey-items-arizona-1998-2000\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study documented concentrations and
  potential effects of organochlorine compounds and metals in addled eggs and potential
  prey of the endangered southwestern willow flycatcher collected from 10 Arizona
  breeding areas and from one California site. DDE was the only organochlorine insecticide
  detected in egg samples. DDE, at levels detected in this study ( 6.0 ug/g). One
  egg sample contained a potentially toxic concentration of selenium (7.07 ug/g).
  Selenium concentrations in flycatcher eggs were highly variable, both among years
  and among breeding areas, indicating a certain degree of unpredictability as to
  individuals or populations could be adversely affected. Boron in two flycatcher
  prey item samples exceeded the lowest adverse effect level. Flycatcher prey samples
  were not collected from the San Joaquin Valley, California, an area with historically
  high boron concentrations. The geometric mean bron concentration in addled egg samples
  from the San Joaquin Valley was significantly higher than the geometric mean for
  eggs collected from Arizona sites.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
